import React, { Component } from 'react';
import {Button, Header, Icon, Image, Menu, Segment, Sidebar } from 'semantic-ui-react'
import { Link } from 'react-router-dom';

class AppSidebar extends Component {
  state = { visible: false }

    render() {
      const { activeItem } = this.state

      return (
        <Sidebar.Pusher>    
            <Sidebar
                as={Menu}
                animation='push'
                direction='left'
                icon='labeled'
                inverted
                visible='true'
                vertical
                width='thin'
            >
            <Menu.Item as='a'>
                <Icon name='home' />
                Lexis
            </Menu.Item>
            <Menu.Item as='a'>
                Page 1
            </Menu.Item>
            <Menu.Item as='a'>
                Page 2
            </Menu.Item>
            </Sidebar>

            </Sidebar.Pusher>
      )
    }
}

export default AppSidebar;
